import React from 'react';
import Nav from './Nav';
import './css/main.css';

function Main() {
    return (
        <div style={{ display: 'flex', flex: 1 }}>
            <Nav />
            <body>
                <div>
                    <button type="button">게시글 작성하기</button>
                </div>
            </body>
        </div>
    );
}

export default Main;
